data.value:
Погрузитесь в Бассейны Ньютона – захватывающий фрактал, основанный на методе Ньютона для нахождения корней полинома. Каждая точка комплексной плоскости окрашивается в зависимости от того, к какому корню полинома она сходится при итерациях. Изменение полинома приводит к созданию уникальных, сложных узоров с яркими границами между бассейнами притяжения.

Особенности:
Ввод пользовательских полиномов;
Выбор цветовых палитр для отображения бассейнов;
Настройка количества итераций;
Масштабирование и панорамирование.
